Hey guys! I'm trying to get the staking working with smart contract on localnet. I want to call the precompile from contract. I am using the new precompile version 2 (0x0000...00805) (https://github.com/opentensor/subtensor/blob/main/precompiles/src/solidity/stakingV2.sol). 

I am able to call precompile directly from Remix and it works as expected!

But I cant figure out how to call the same precompile from contract, it always fails.
Has anyone solved this? I would greatly appreciate some help.

Here is the contract code, inspired by examples on bittensor docs.

```
// SPDX-License-Identifier: GPL-3.0
// 
// This example demonstrates calling of IStaking precompile 
// from another smart contract

pragma solidity ^0.8.24;

interface IStaking {
  function addStake(bytes32 hotkey, uint256 amount, uint256 netuid) external payable;
}
contract StakeProxy {
  address constant ISUBTENSOR_STAKING_ADDRESS = 0x0000000000000000000000000000000000000805;
  bytes32 constant HOTKEY = 0xdca7310ab2e5d6ce468c3f629650100883bac45492b868813f9dd62af05ddd3f;
  uint256 constant NETUID = 2;

  function stakeViaContract() external payable {
    require(msg.value > 0, "send TAO");

    IStaking stakingPrecompile = IStaking(ISUBTENSOR_STAKING_ADDRESS);
        (bool success, ) = ISUBTENSOR_STAKING_ADDRESS.call{value: msg.value}(
            abi.encodeWithSelector(stakingPrecompile.addStake.selector, HOTKEY, msg.value, 2)
        );
        require(success, "Staking call failed");
  }
}
```

